import './Home.css'
import 'bootstrap/dist/css/bootstrap.css'
import ButtonNext from '../../components/ButtonNext/ButtonNext';

function Home () {
    return (
        <main id="home" class="border-0 d-flex flex-column justify-content-sm-around col-12 position-absolute fixed-top mt-5">
            <h1 >nomadi<span>.</span></h1>
            <section class="border-0 d-flex flex-column col-8">
                <ButtonNext href="/origem">Fazer um pedido</ButtonNext>
                <ButtonNext href="/origem">Falar com um consultor</ButtonNext> 
                {/* Abrir modal com informações básicas */}
            </section>
        </main>
    )
}

export default Home
